INSERT INTO `products` (`id`, `title`, `slug`, `sku`, `price_pen`, `price_usd`, `description`, `resumen`, `imagen`, `state`, `tags`, `brand_id`, `categorie_first_id`, `categorie_second_id`, `categorie_third_id`, `stock`, `created_at`, `updated_at`, `deleted_at`) VALUES
(2, 'Consola Ps5 Slim 1 Tb Con Lector Marvel Spiderman 2 Bundle', 'consola-ps5-slim-1-tb-con-lector-marvel-spiderman-2-bundle', 'Consola-Ps5-Slim', 2855, 1000, '<p>Consola Playstation 5 Slim 1 TB Marvel Spiderman 2 Bundle.<br />\r\n<br />\r\nDisponible para entrega inmediata.<br />\r\n<br />\r\nCon un dise&ntilde;o asombroso de simbionte vive el pr&oacute;ximo cap&iacute;tulo de la franquicia Marvel&rsquo;s Spider-Man 2, trae un voucher para obtener el juego y muchos beneficios.<br />\r\n<br />\r\nExperimenta la aventura como Peter Parker y Miles Morales mientras se enfrentan al desaf&iacute;o definitivo para proteger la ciudad de Venom y la amenaza de los simbiontes. Balanc&eacute;ate, salta y utiliza las nuevas alas de telara&ntilde;a para explorar toda la ciudad de Nueva York de Marvel. Tambi&eacute;n tendr&aacute;s la posibilidad de alternar r&aacute;pidamente entre Peter Parker y Miles Morales para experimentar diferentes historias y desatar poderes nuevos y &eacute;picos, mientras que el emblem&aacute;tico villano Venom amenaza con destruir sus vidas, la ciudad y a todos sus seres queridos.<br />\r\n<br />\r\nAdem&aacute;s, el control DualSense para PS5 combina estilo y tecnolog&iacute;a para que jugar sea m&aacute;s c&oacute;modo e interactivo para todos sus jugadores.<br />\r\n<br />\r\nAdaptada a tus necesidades<br />\r\nGuarda tus apps, fotos, videos y mucho m&aacute;s en el disco duro, que cuenta con una capacidad de 1TB.<br />\r\nPor otro lado, tiene puerto USB y salida HDMI, que permiten conectar accesorios y cargar la bater&iacute;a de tu control mientras juegas.<br />\r\n<br />\r\nMarca: Sony<br />\r\nTipo: Consola<br />\r\nPlataforma: Playstation 5<br />\r\nColor: Blanco<br />\r\nCapacidad: 1 TB</p>', 'Con un diseño asombroso de simbionte vive el próximo capítulo de la franquicia Marvel’s Spider-Man 2, trae un voucher para obtener el juego y muchos beneficios', 'products/87AO5jbua29tiV51DcRGA3MKoku3mn618fV65viv.webp', 2, '[{\"item_id\":1705929977303,\"item_text\":\"ps5\"},{\"item_id\":1705929982703,\"item_text\":\"ps5 slim\"},{\"item_id\":1705929988256,\"item_text\":\"spiderman 2\"}]', 3, 1, 2, 5, 35, '2024-01-13 05:42:59', '2024-01-22 18:27:25', NULL),
(3, 'Apple iPhone 15 Pro Max (256 GB) - Titanio Negro', 'apple-iphone-15-pro-max-256-gb-titanio-negro', 'Apple-iPhone 15', 5679, 2500, '<p><samp><kbd>iPhone 15 Pro Max. Forjado en titanio y equipado con el revolucionario chip A17 Pro, un Botón de Acción personalizable y el sistema de cámaras más potente en un iPhone.<br />\r\n<br />\r\nFORJADO EN TITANIO &mdash; El iPhone 15 Pro Max tiene un dise&ntilde;o resistente y ligero, con titanio de calidad aeroespacial y parte posterior de vidrio mate texturizado. Frente de Ceramic Shield, m&aacute;s duro que el vidrio m&aacute;s duro de cualquier smartphone. Y resistencia a las salpicaduras, al agua y al polvo.<br />\r\n<br />\r\nPANTALLA AVANZADA &mdash; La pantalla Super Retina XDR de 6.7 pulgadas con ProMotion aumenta la frecuencia de actualizaci&oacute;n hasta 120 Hz cuando necesitas el m&aacute;ximo rendimiento gr&aacute;fico. La Dynamic Island muestra alertas y Actividades en Vivo al instante. Y la pantalla siempre activa te permite tener informaci&oacute;n siempre a la vista sin mover un dedo.<br />\r\n<br />\r\nREVOLUCIONARIO CHIP A17 PRO &mdash; Con el GPU de nivel pro, los juegos m&oacute;viles son m&aacute;s inmersivos, con escenarios llenos de detalles y personajes m&aacute;s realistas. Y el chip A17 Pro es tan eficiente que la bater&iacute;a es capaz de seguirte el ritmo todo el d&iacute;a.<br />\r\n<br />\r\nSISTEMA DE C&Aacute;MARAS PRO &mdash; Multiplica tus opciones de encuadre con 7 lentes pro. Toma fotos en superalta resoluci&oacute;n con m&aacute;s colores y detalles que nunca con la c&aacute;mara gran angular de 48 MP. Y captura primeros planos supern&iacute;tidos desde m&aacute;s lejos con la c&aacute;mara teleobjetivo de 5x del iPhone 15 Pro Max.<br />\r\n<br />\r\nBOT&Oacute;N DE ACCI&Oacute;N PERSONALIZABLE &mdash; El Bot&oacute;n de Acci&oacute;n te lleva volando a tu funcionalidad favorita, como el modo Silencio, C&aacute;mara, Nota de Voz o Atajos. Config&uacute;ralo con la que quieras usar y mantenlo presionado para que haga su magia.<br />\r\n<br />\r\nCONEXION ES MUY PRO &mdash; El nuevo conector USB-C te permite cargar tu Mac o iPad con el mismo cable que usas para cargar el iPhone 15 Pro Max. Con USB 3, las velocidades de transferencia pisan el acelerador a fondo. Y con la conexi&oacute;n Wi‐Fi 6E, podr&aacute;s descargar archivos hasta el doble de r&aacute;pido.<br />\r\n<br />\r\nFUNCIONALIDAD ESENCIAL DE SEGURIDAD &mdash; Con Detecci&oacute;n de Choques, el iPhone puede identificar si sufres un accidente de auto grave y pedir ayuda cuando t&uacute; no puedes.<br />\r\n<br />\r\nINNOVACIONES QUE MARCAN LA DIFERENCIA &mdash; El iPhone cuenta con tecnolog&iacute;as de privacidad que te ayudan a mantener el control de tus datos. Est&aacute; fabricado con m&aacute;s materiales reciclados para reducir su impacto medioambiental. Y viene con funcionalidades integradas que lo hacen accesible para todo el mundo.<br />\r\n<br />\r\nAviso legal<br />\r\n(1) El iPhone 15, iPhone 15 Plus, iPhone 15 Pro y iPhone 15 Pro Max son resistentes a las salpicaduras, al agua y al polvo, y fueron probados en condiciones de laboratorio controladas, con una clasificaci&oacute;n IP68 seg&uacute;n la norma IEC 60529 (hasta 30 minutos a una profundidad m&aacute;xima de 6 metros). La resistencia a las salpicaduras, al agua y al polvo no es una condici&oacute;n permanente, y podr&iacute;a disminuir como consecuencia del uso normal. No intentes cargar un iPhone mojado; consulta el manual del usuario para ver las instrucciones de limpieza y secado. La garant&iacute;a no cubre da&ntilde;os producidos por l&iacute;quidos.<br />\r\n(2) La pantalla tiene las esquinas redondeadas. Si se mide en forma de rect&aacute;ngulo, la pantalla tiene 6,12 pulgadas (iPhone 15 Pro y iPhone 15) o 6,69 pulgadas (iPhone 15 Pro Max y iPhone 15 Plus) en diagonal. El &aacute;rea real de visualizaci&oacute;n es menor.<br />\r\n(3) La duraci&oacute;n de la bater&iacute;a var&iacute;a seg&uacute;n el uso y la configuraci&oacute;n. Para obtener m&aacute;s informaci&oacute;n, visita apple.com/co/batteries.<br />\r\n(4) Se requiere un cable USB 3 de 10 Gb/s para alcanzar velocidades de transferencia hasta 20 veces m&aacute;s r&aacute;pidas en los modelos de iPhone 15 Pro.<br />\r\n(5) Wi-Fi 6E est&aacute; disponible en los pa&iacute;ses y regiones donde hay compatibilidad.<br />\r\n(6) El iPhone 15 y el iPhone 15 Pro pueden detectar si sufres un accidente automovil&iacute;stico grave y pedir ayuda. Requiere conexi&oacute;n celular o llamadas por Wi-Fi.</kbd></samp></p>', 'iPhone 15 Pro Max. Forjado en titanio y equipado con el revolucionario chip A17 Pro, un Botón de Acción personalizable y el sistema de cámaras más potente en un iPhone', 'products/24VbnNWds8SmMAOciTUTKaqpNdtiVPxjy9oNIOZY.webp', 2, '[{\"item_id\":1705930402576,\"item_text\":\"iphone 14\"},{\"item_id\":1705930408848,\"item_text\":\"256gb\"},{\"item_id\":1705930412984,\"item_text\":\"titinario negro\"},{\"item_id\":1705930417201,\"item_text\":\"apple\"}]', 7, 29, NULL, NULL, 0, '2024-01-13 05:51:32', '2024-01-27 11:26:15', NULL),
(4, 'Samsung Galaxy A54 5G 5G 256 GB awesome graphite 8 GB RAM', 'samsung-galaxy-a54-5g-5g-256-gb-awesome-graphite-8-gb-ram', 'Samsung-Galaxy-A54', 1500, 490, '<p>Fotograf&iacute;a profesional en tu bolsillo<br />\r\nDescubre infinitas posibilidades para tus fotos con las 3 c&aacute;maras principales de tu equipo. Pon a prueba tu creatividad y juega con la iluminaci&oacute;n, diferentes planos y efectos para obtener grandes resultados.<br />\r\n<br />\r\nExperiencia visual incre&iacute;ble<br />\r\nMira tus series y pel&iacute;culas favoritas con la mejor definici&oacute;n a trav&eacute;s de su pantalla Super AMOLED de 6.4&quot;. Disfruta de colores brillantes y detalles precisos en todos tus contenidos.<br />\r\n<br />\r\nCapacidad y eficiencia<br />\r\nCon su potente procesador y memoria RAM de 8 GB tu equipo alcanzar&aacute; un alto rendimiento con gran velocidad de transmisi&oacute;n de contenidos y ejecutar&aacute; m&uacute;ltiples aplicaciones a la vez sin demoras.<br />\r\n<br />\r\nDesbloqueo veloz con tu huella digital<br />\r\nCon el sensor de huella digital, el acceso es seguro y podr&aacute;s desbloquearlo autom&aacute;ticamente con un toque.<br />\r\n<br />\r\nBater&iacute;a de duraci&oacute;n superior<br />\r\n&iexcl;Desench&uacute;fate! Con la s&uacute;per bater&iacute;a de 5000 mAh tendr&aacute;s energ&iacute;a por mucho m&aacute;s tiempo para jugar, ver series o trabajar sin necesidad de realizar recargas.</p>\r\n\r\n<ul>\r\n	<li>Dispositivo desbloqueado para que elijas la compa&ntilde;&iacute;a telef&oacute;nica que prefieras.</li>\r\n	<li>Compatible con redes 5G.</li>\r\n	<li>Pantalla Super AMOLED de 6.4&quot;.</li>\r\n	<li>Tiene 3 c&aacute;maras traseras de 50Mpx/12Mpx/5Mpx.</li>\r\n	<li>C&aacute;maras delanteras de 32MP.</li>\r\n	<li>Procesador Exynos 1380 Octa-Core de 2.4GHz con 8GB de RAM.</li>\r\n	<li>Bater&iacute;a de 5000mAh.</li>\r\n	<li>Memoria interna de 256GB.</li>\r\n	<li>Resistente al agua.</li>\r\n	<li>Con sensor de huella dactilar.</li>\r\n	<li>Resistente al polvo.</li>\r\n</ul>', 'Descubre infinitas posibilidades para tus fotos con las 3 cámaras principales de tu equipo. Pon a prueba tu creatividad y juega con la iluminación, diferentes planos y efectos para obtener grandes resultados.', 'products/pR7qQQfR0oYqW9aGPOrggy6HasVGmwENiD6B8345.webp', 2, '[{\"item_id\":1705929523567,\"item_text\":\"256 GB\"},{\"item_id\":1705929530374,\"item_text\":\"graphite 8 GB RAM\"},{\"item_id\":1705929535349,\"item_text\":\"Samsung Galaxy A54\"}]', 2, 29, NULL, NULL, 0, '2024-01-22 13:19:54', '2024-01-22 18:23:05', NULL),
(5, 'Monitor Gaming Odyssey G3 De 24 . Fhd, 165hz, 1ms', 'monitor-gaming-odyssey-g3-de-24-fhd-165hz-1ms', 'Gaming-Odyssey-G3', 799, 250, '<p>24 pulgadas, tasa de refresco de 165 Hz y 1ms de tiempo de respuesta (MPRT)<br />\r\nConquista a cada enemigo! La tasa de refresco de 165 Hz reduce la demora y mejora el efecto de movimiento para lograr acci&oacute;n incre&iacute;blemente fluida.<br />\r\nHaz que cada movimiento cuente gracias al tiempo de respuesta de 1 ms. Los p&iacute;xeles de la pantalla cambian de color con una respuesta casi instant&aacute;nea. Tu desempe&ntilde;o en la pantalla es tan r&aacute;pido como tus propios reflejos.<br />\r\n<br />\r\nDise&ntilde;o ergon&oacute;mico con base tipo HAS<br />\r\nAlcanza la cima de la victoria. Gira, inclina, ajusta y hasta rota tu monitor hasta que todos los enemigos est&eacute;n perfectamente a la vista. La pantalla se puede mover libremente para que puedas encontrar el &aacute;ngulo m&aacute;s c&oacute;modo.<br />\r\n<br />\r\nDise&ntilde;o sin bordes de 3 lados<br />\r\nEl dise&ntilde;o sin bordes de tres lados ofrece el m&aacute;ximo espacio disponible para que disfrutes de un juego m&aacute;s completo y audaz. Alinea dos pantallas con precisi&oacute;n en una configuraci&oacute;n de monitor doble para que ning&uacute;n enemigo se escape<br />\r\n<br />\r\nAMD FreeSync Premium<br />\r\nExperimenta una capacidad de juego fluido sin esfuerzo. AMD FreeSync Premium incluye tecnolog&iacute;a de sincronizaci&oacute;n adaptable para reducir cortes, incorrecciones de im&aacute;genes y latencia de entrada. La compensaci&oacute;n de velocidad baja de los fotogramas te garantiza la fluidez de cada escena, sin ning&uacute;n inconveniente.<br />\r\n<br />\r\nModo Protecci&oacute;n visual y funci&oacute;n antititileo<br />\r\nAhora podr&aacute;s jugar durante m&aacute;s tiempo. El modo Protecci&oacute;n visual minimiza la luz azul lo suficiente como para mantener los ojos relajados y c&oacute;modos cuando juegues durante per&iacute;odos prolongados. Adem&aacute;s, la tecnolog&iacute;a antititileo reduce constantemente el parpadeo molesto e irritante de la pantalla para que puedas enfocarte en el juego durante m&aacute;s tiempo, con menos distracci&oacute;n o fatiga ocular.<br />\r\n<br />\r\n3 A&ntilde;os de garant&iacute;a<br />\r\nTu monitor Samsung est&aacute; hecho para durar. Aprovecha sus 36 meses de garant&iacute;a contra defectos de fabricaci&oacute;n (ver politica de garant&iacute;a para mas detalles)&quot;</p>', '24 pulgadas, tasa de refresco de 165 Hz y 1ms de tiempo de respuesta (MPRT) Conquista a cada enemigo! La tasa de refresco de 165 Hz reduce la demora y mejora el efecto de movimiento para lograr acción increíblemente fluida', 'products/vk7CiHkUH6rmCjf0r1cSRKh5775TFLLgseU2HOY8.webp', 2, '[{\"item_id\":1705931752845,\"item_text\":\"Monitor Gaming\"},{\"item_id\":1705931759526,\"item_text\":\"Odyssesy\"},{\"item_id\":1705931765174,\"item_text\":\"165hz\"}]', 2, 12, 13, 18, 44, '2024-01-22 13:57:36', '2024-02-08 04:10:25', NULL),
(6, 'Refrigeradora Electrolux 436l No Frost Inverter Ersa44v2hvg Color Gris', 'refrigeradora-electrolux-436l-no-frost-inverter-ersa44v2hvg-color-gris', 'Electrolux-436l', 1949, 680, '<p>Refrigerador Electrolux 436L No Frost Inverter ERSA44V2HVG<br />\r\n<br />\r\nEl Refrigerador Electrolux Side by Side es ideal para tu cocina, aportando practicidad y eficacia en tu d&iacute;a a d&iacute;a, adem&aacute;s de presentar un dise&ntilde;o moderno y elegante.<br />\r\n<br />\r\nLa funci&oacute;n AutoSense controla autom&aacute;ticamente la temperatura y prolonga la vida de los alimentos por hasta un 30%&sup1; m&aacute;s, evitando desperdicio.<br />\r\n<br />\r\nPara que la temperatura del nevec&oacute;n sea m&aacute;s estable, el ERSA44V3HVG Electrolux tambi&eacute;n cuenta con Tecnolog&iacute;a Inverter, que garantiza condiciones ideales para preservar tus alimentos y ahorra energ&iacute;a.<br />\r\n<br />\r\nCon el Panel Digital del nevec&oacute;n, controle la temperatura y las funciones Turbo Freezer y Turbo Refrigerador que te permiten congelar y refrigerar las comidas y bebidas m&aacute;s r&aacute;pidamente.<br />\r\n<br />\r\nBasta girar la bandeja y los cubitos de hielo caen en el compartimento inferior para que tengas hielo siempre a mano, con Ice Twister tienes m&aacute;s facilidad para tu d&iacute;a a d&iacute;a.<br />\r\n<br />\r\nAdem&aacute;s, el refrigerador ofrece la organizaci&oacute;n ideal para que preserve frutas y verduras de la mejor manera. Por eso cuentas con dos cajones especiales en el refrigerador y dos cajones en el congelador.<br />\r\n<br />\r\nAutoSense: Controla la temperatura autom&aacute;ticamente y prolonga la vida de los alimentos hasta un 30%&sup1; m&aacute;s tiempo.<br />\r\n<br />\r\nTecnolog&iacute;a Inverter: Mantiene la temperatura del motor estable garantizando ahorro de energ&iacute;a y menos desperdicio de alimentos.<br />\r\n<br />\r\nPanel digital: Controla la temperatura y funciones de acuerdo con lo que necesites.<br />\r\n<br />\r\nIceTwister: Hielo siempre a mano para que tengas tus bebidas a&uacute;n m&aacute;s refrescantes.<br />\r\n<br />\r\nDos cajones en el refrigerador y dos cajones en el congelador: M&aacute;s organizaci&oacute;n en tu d&iacute;a a d&iacute;a y mejor preservaci&oacute;n de los alimentos.<br />\r\n<br />\r\nTurbo Refrigerador: Enfriamiento r&aacute;pido del refrigerador. Indicado para cuando vuelves con las compras del supermercado.<br />\r\n<br />\r\nTurbo Freezer: Enfriamiento r&aacute;pido del congelador. Indicado para cuando necesitas congelar alimentos y bebidas r&aacute;pidamente.<br />\r\n<br />\r\nBandeja de huevos: M&aacute;s comodidad y organizaci&oacute;n en tu refrigerador, con capacidad para 12 huevos.<br />\r\n<br />\r\n&sup1;Resultados obtenidos en testeos realizados por la FURB (Universidad Regional de Blumenau) con frutillas y leche.</p>', 'El Refrigerador Electrolux Side by Side es ideal para tu cocina, aportando practicidad y eficacia en tu día a día, además de presentar un diseño moderno y elegante', 'products/JG5k2PmFQp0NugCUayPB2LbvSTtOrTSilP2FG4bg.webp', 2, '[{\"item_id\":1705933235482,\"item_text\":\"Electrolux \"},{\"item_id\":1705933280763,\"item_text\":\"436l\"},{\"item_id\":1705933285435,\"item_text\":\"Inverter Ersa44v2hvg\"}]', 3, 1, 3, 10, 25, '2024-01-22 14:21:57', '2024-01-22 19:26:51', NULL),
